let videosState = {
    nowPlayingVid : '6BYIKEH0RCQ',
    searchHistory: [],
    videos: [],
    played: [],
    bookmarked: []
}

 export function videosReducer(state = videosState, action) {
     let stateCopy = JSON.parse(JSON.stringify(state))
    switch (action.type) {
        case "Videos":
            stateCopy.videos = action.payload
        return stateCopy
        default:
            return stateCopy
    }
}
